<?php	require_once ("\../lib\\common\\dao\\VO.class.php");	class Module extends VO {		private $moduleid;		private $serialindex;		private $modulename;		private $moduletext;		private $access;		private $description;		public function setModuleid($moduleid){			$this->moduleid=$moduleid;		}		public function getModuleid(){			return $this->moduleid;		}		public function setSerialindex($serialindex){			$this->serialindex=$serialindex;		}		public function getSerialindex(){			return $this->serialindex;		}		public function setModulename($modulename){			$this->modulename=$modulename;		}		public function getModulename(){			return $this->modulename;		}		public function setModuletext($moduletext){			$this->moduletext=$moduletext;		}		public function getModuletext(){			return $this->moduletext;		}		public function setAccess($access){			$this->access=$access;		}		public function getAccess(){			return $this->access;		}		public function setDescription($description){			$this->description=$description;		}		public function getDescription(){			return $this->description;		}		public function __toString(){			return "moduleid=".$this->moduleid.", serialindex=".$this->serialindex.", modulename=".$this->modulename.", moduletext=".$this->moduletext.", access=".$this->access.", description=".$this->description;		}	}?>